import React from 'react';
import '../css/dashboard.css';
import { Shortcuts } from './Dashboard-main/shortcuts';
import {Tracker} from './Dashboard-main/tracker';
import { TodayTask } from './Dashboard-main/todayTask';
import { FlashCards } from './Dashboard-main/flashCards';

export const Content=()=>{
    return(
        <div style={{display:'flex',alignContent:'center',justifyContent:'center'}}>
            <div className="main" style={{width:'95%'}}>
                <div style={{width:'4.2%'}}>
                    <Shortcuts/>
                </div>
                <div className="task-tracker">
                    <Tracker/>
                </div>
                <div className='today-task'>
                    <TodayTask/>
                </div>
                <div>
                    <FlashCards/>
                </div>
                <div style={{width:'22%',display:'flex',flexDirection:'column',alignItems:'center',justifyContent:'space-between',height:'95%'}}>
                    <div style={{height:'15%',background:'green',width:'100%',borderRadius:'5px'}}>p</div>
                    <div style={{height:'25%',background:'red',width:'100%',borderRadius:'5px'}}>p</div>
                    <div style={{height:'40%',background:'blue',width:'100%',borderRadius:'5px'}}>p</div>
                </div>
            </div>
        </div>
    )
}
